@gi__222 겉에 두르는게 다 한복이랑 안어울려서 조끼형 입었는데 팔이 제대로 얼어서 빨갛게 됐었사옵니다..^^...
어울림을 얻고 추움도 얻었지요^^ .   .

옴멤메 ^^ 꽉 안아준다니 소녀 가슴이 설레이다못해 벌렁거려서 콧구멍도 벌렁거립니다

@byooqwas 아ㅠㅜ!!!!!!!!!근데 쩌기 뒤에서 황쌤 
백쌤과 다른색상의 생활한복 입은채로 수줍게
개죽웃음 지으며 안입는다고 했는데..ㅎㅎ 마침 오늘 나갈 진도도 관동별곡이라 황쌤만 개쭈아한 만우절날

@byooqwas 아 한복 ㅋㅋㅋㅋㅠㅜ
미치것네 진짜ㅋㅋㅋㅋㅋ 애들이 봐달라고 할때마다 한복타령하던 백쌤
쌤들과 내기에서 져서 만우절날 생활한복 .. 입고 애들 맞이해주실듯

@ch80280189 꽥꽥 짜증내는 여학생들…. 
아 쌤 봐달라니까요ㅜㅜㅜ 
-한복 입고 다니라고 하기 전에 똑바로 입어라

@sikmulhem 아 맞다 요샌 생활한복이라고 부르지. 
그런데 저는 애당초 기성복을 냅두고 생활한복을 찾게 되는 정서에 공감을 못하고 있어요 
애국심이 0이어서 그런가…

@ggaegull 확실히 기모노라 비싼것일까요....
한복도 5시간 대여에 3만원즈음 할텐데...
그나저나 일본얘기에 푸딩생각하며 침흘리고 있습ㄴ디ㅏ 흥ㅜㅜㅜ

@iampro___ 아ㅠ왜 주인님 된 거냐고..........좋다......(;)
너무 좋겠네여......풀정장에 답호랑 도포까지 걸치고있다가 군락에 발 들이는 순간 편안한 한복으로 옷 바뀌면 ㅋㅋ
이게 집이지. 할 수밖에 없음

